import { BrowserRouter, Routes, Route, NavLink } from 'react-router-dom';
import NewsPage from './components/NewsPage';
import Category from './components/NavLink';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='' element={<NavLink></NavLink>} />
        <Route path="*" element={<NewsPage></NewsPage>} />
      </Routes>
    </BrowserRouter>);
}

export default App;
